 function searchTable () {
  const filter1 = document.getElementById("myInput5").value.trim();
  const filter2 = document.getElementById("myInput6").value.trim();

  const tableRows = document.getElementById("table").getElementsByTagName("tr");

  for (const tr of tableRows) {
    if (tr.id === 'tableHeader') continue;

    const td1 = tr.querySelector("td:nth-of-type(1)");
    const td2 = tr.querySelector("td:nth-of-type(2)");

    const shouldBeVisible = (
      td1.textContent.trim().includes(filter1)
      && td2.textContent.trim().includes(filter2)
    );

    tr.style.display = shouldBeVisible ? "" : "none";
  }
}
 
 
